import React, { Component } from 'react';
import './App.css';
import Box from './Box.js'

class User extends Component {
  constructor(props){
    super(props)
    this.state = {
        board: ["", "","", "", "", "", "", "", ""],
        user: "X"
      }
  }


  render(){
    let { board } = this.state
    let gameBoard = board.map((value, index) => {
      return (
        <Box
          value={value}
          index={index}
          gameBoard={this.gameBoard}
        />
      )
    })
    return (
      <div>
        <div id="gameBoard">
          {gameBoard}
        </div>
      </div>
    )
  }
}

export default User;
